import React from "react";
import "./css/contents.css";
import {
    BrowserRouter as Router
} from "react-router-dom";


class Contents extends React.Component {
    navigate() {
        console.log(this.props.history);
        this.props.history.push("/");
    }
    render() {
        return (
            <>
                <h2>目次</h2>
            <div className="contents">
                <Router>
                    <ol className="daily-archive">

                        <li className="daily-archive__item">
                            <a href="./1">
                                    <span className="daily-num">Day 1 - <span className="title">すべての時間軸に抗う" ために</span></span>
                            </a>
                        </li>
                        <li className="daily-archive__item">
                            <a href="./2">
                                    <span className="daily-num">Day 2 - <span className="title">月と星のあいだ</span></span>
                            </a>
                        </li>
                    </ol>
                </Router>
            </div>
            </>
        );
    }
}


export default Contents;
